export const setLoggedinUser = payload => ({
  type: 'SET_LOGGEDIN_USER',
  payload
})

export const setRestaurants = payload => ({
  type: 'SET_RESTAURANTS',
  payload
})

export const setFavorites = payload => ({
  type: 'SET_FAVORITES',
  payload
})
